import React, {useState} from 'react';


const MovieList = () => {
    const[movies, setMovies] = useState([
        {
            name: 'Harry Pottter',
            price: '$10',
            id: 23124
        },
        {
            name: 'Game of Thrones',
            price: '$10',
            id: 2566124
        },
        {
            name: 'Inception',
            price: '$10',
            id: 23524
        }
    ]);
    return(
        <div>
        {movies.map(movie => (
        <li>{movie.name}</li>
        ))}
        </div>
    );
}
export default MovieList;
